import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Index from "./index";
// import IndexAdmin from "./backend/IndexAdmin";
import FrontendRoute from "./route/frontend";
// import BackendRoute from "./routes/BackendRoute";
///
import './front_end/assets/css/nucleo-icons.css';
import './front_end/assets/css/nucleo-svg.css';
import './front_end/assets/css/argon-dashboard-tailwind.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

function App() {
  return (
      <Router>
        <Routes path="/" element={<Index />}>
          {/* Frontend Routes */}
          {FrontendRoute.map((route, index) => {
            const Page = route.component;
            return <Route key={index} path={route.path} element={<Page />} />;
          })}

          {/*/!* Backend Routes *!/*/}
          {/*{BackendRoute.map((route, index) => {*/}
          {/*  const Page = route.component;*/}
          {/*  return <Route key={index} path={route.path} element={<Page />} />;*/}
          {/*})}*/}

          {/* Catch-all NotFound Route */}
          <Route path="*" element={<h1>404 - Page Not Found</h1>} />
        </Routes>
      </Router>
  );
}

export default App;
